import { Link } from "react-router-dom";

const Directory = ({categoories}) => {
    return(
        <div>
        {categories.map((category) =>(
            <Link to={`/${category.title}`}>
                <h1 key={category.id}>{category.title}</h1>            
            </Link> 
        ))}
        </div>
    )
}

export default Directory;
